import * as React from 'react';
import Container from '@mui/material/Container';
import Nav from './component/Nav';
import CollapsibleTable from './component/Table/CollapsibleTable';
import SimplePaper from './component/Write/Write';
import { BrowserRouter, Route, Routes} from 'react-router-dom';
import axios from 'axios'



export default function App() { const [state, setState] = React.useState([])
  const [hasError, setHasError, open, setOpen] = React.useState(false)
  React.useEffect(async () => {
     await axios.get("http://localhost:8080/api").then(res => setState(res.data.test)).catch(err => setHasError(true))}, []);
    console.log(state)
  return (
    <BrowserRouter>
      <Container>
        <Nav/>
        <Routes>
          <Route path="/board/" element={<CollapsibleTable/>}></Route>
          <Route path="/pages" element={<SimplePaper/>}></Route>  
        </Routes>
      </Container>
    </BrowserRouter>  
  );
}
